import React, { useState} from 'react';
import './AdminRegistrationForm.css'
import axios from 'axios'
import { useNavigate } from 'react-router-dom';
import {Link} from 'react-router-dom';

function AdminRegistrationForm(event) {

    const navigation=useNavigate()


    const [formData, setFormData] = useState(event.target)

    const registeradmin = async(event) => {
        console.log("run reg func")
        event.preventDefault();

        const formData = new FormData(event.target);
        const data = Object.fromEntries(formData)

        const res = await axios.post('http://localhost:5000/api/v1/adminregister', data, {
            headers: {
                'Content-Type': 'application/json'
            }
        }).then((res) => {

            if (!alert("You have successfully registered!"))navigation("/AdminLogin");
        }).catch((err) => {
            console.log(err)
            alert(err.message)
        })

        console.log(res.status);
        if (res.status ===201) console.log(res.data);
            if(res.status === 500){
                console.log("fire");
                const {error} = res.data
                console.log(error);
            }
    };

    return (
        <div className='bgimg2'>
        <form className="form" onSubmit={registeradmin}>

            <h1 className=''>Admin Registration Form</h1>
            <div className="form-body">

            <div className='fullname'>
                <label className='form__label'>Full Name: </label>
                <input 
                    className="form__input" 
                    type="text" 
                    name="fullName"
                    onChange={(e) =>
                        setFormData({ 
                            ...formData, 
                            name: e.target.value 
                        })
                    }
                placeholder="Full Name"/>
            </div>

            <div className='iname'>            
            <label className="form__label" for="iName">Name with Initials :</label>
            <input className="form__input" 
            type="text" 
            name="iName"
            onChange={(e) =>
                setFormData({
                    ...formData,
                    iName: e.target.value
                })
            }
            placeholder="Name with Initials"/>
        </div>

            <div className='nicNumber'>
            <label className='form__label'>NIC Number: </label>
            <input 
            className='form__input' 
            type="text" 
            name="ssn" 
            onChange={(e) =>
                setFormData({
                    ...formData,
                    nicNum: e.target.value,
                })
            }
            placeholder="NIC Number"/>
        </div>

        <div className='birthday'>            
            <label className='form__label ' for="birthday">Birthday :</label>
            <input 
            className='calender form__input' 
            type="date" 
            name="dateOfBirth"
            onChange = {(e) =>
                setFormData({
                    ...formData,
                    birthday: e.target.value,
                })
            }/>
        </div>

        <div className='email'>
            <label className='form__label'>Email: </label>
            <input className='form__input' 
            type="email" 
            name = "email"
            onChange={(e) =>
                setFormData({
                    ...formData,
                    email: e.target.value,
                })
            }
            placeholder="Email"/>
        </div>

        <div className='password'>
            <label className='form__label'>Password: </label>
            <input className='form__input' 
            type="password" 
            name = "password"
            onChange={(e) =>
                setFormData({
                    ...formData,
                    password: e.target.value,
                })
            }
            placeholder="Password"/>
        </div>

        <div className='contactNumber'>
            <label className='form__label'>Contact Number: </label>
            <input className="form__input" 
            type="number" 
            name = "contactNumber" 
            onChange={(e) =>
                setFormData({
                    ...formData,
                    contactNum: e.target.value,
                })
            }
            placeholder="Contact Number"/>
        </div>

    </div>

     {/* -------------button---------- */}
        <div className="">
            <button type="submit"  className="btn_1"><Link to='/Admin/AdminLogin.jsx'>Register</Link></button>
        </div>  

    </form></div>
    )
}

export default AdminRegistrationForm;
